// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import "../../node_modules/@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

import "./BacchusVaultGovernor.sol";
import "./BacchusVaultGovernorSettings.sol";
import "./BacchusVaultGovernorVotes.sol";
import "./BacchusVaultGovernorCounting.sol";

contract BacchusVaultGovernance is
    BacchusVaultGovernor,
    BacchusVaultGovernorSettings,
    BacchusVaultGovernorVotes,
    BacchusVaultGovernorCounting
{
    constructor(ERC1155 _tokenaddress)
        BacchusVaultGovernor("Bacchus Vault Governor")
        BacchusVaultGovernorVotes(_tokenaddress)
        BacchusVaultGovernorSettings(1, 50400, 0)
    {}

    function votingDelay()
        public
        pure
        override(IBacchusVaultGovernor, BacchusVaultGovernorSettings)
        returns (uint256)
    {
        return 6575; // 1 day
    }

    function votingPeriod()
        public
        pure
        override(IBacchusVaultGovernor, BacchusVaultGovernorSettings)
        returns (uint256)
    {
        return 46027; // 1 week
    }

    function proposalThreshold()
        public
        pure
        override(BacchusVaultGovernor, BacchusVaultGovernorSettings)
        returns (uint256)
    {
        return 0;
    }

    function getVotes(address account, uint256 blockNumber)
        public
        view
        override
        returns (uint256)
    {
        return super.getVotes(account, blockNumber);
    }

    function state(uint256 proposalId)
        public
        view
        override
        returns (ProposalState)
    {
        return super.state(proposalId);
    }

    function propose(
        address[] memory targets,
        uint256[] memory values,
        bytes[] memory calldatas,
        string memory description
    )
        public
        override
        returns (uint256)
    {
        return super.propose(targets, values, calldatas, description);
    }

    function _execute(
        uint256 proposalId,
        address[] memory targets,
        uint256[] memory values,
        bytes[] memory calldatas,
        bytes32 descriptionHash
    ) internal override(BacchusVaultGovernor) {
        super._execute(proposalId, targets, values, calldatas, descriptionHash);
    }

    function _cancel(
        address[] memory targets,
        uint256[] memory values,
        bytes[] memory calldatas,
        bytes32 descriptionHash
    ) internal override(BacchusVaultGovernor) returns (uint256) {
        return super._cancel(targets, values, calldatas, descriptionHash);
    }

    function _executor()
        internal
        view
        override(BacchusVaultGovernor)
        returns (address)
    {
        return super._executor();
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(BacchusVaultGovernor)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
